FormAction.Script:
var sessionId = Forms.SessionVariables.getSessionVariable('SESSION_ID');
// to save the profile picture

var imageControl = thisForm.controlManager.getControlByName('profileUpload');
if (imageControl.value != "") {
	var fileName = imageControl.getFiles()[0].name;

	var profile = {
		"DisplayName": Forms.Common.Common.GetResourceName(),
		Identity: {
			"Id": Forms.Common.Common.GetResourceID(),
			"Name": Forms.Common.Common.GetResourceName()
		},
		"ProfilePictureName": Forms.Common.Common.GenerateGUID() + fileName.substring(fileName.indexOf('.')),
		WorkingCategory: {
			"Id": thisForm.formVariables.getFormVariableByName('CategoryId').value
		}
	};
	var reader = new FileReader();
	var imageRawData;
	// Occurs when the image data is read
	reader.onload = function () {
		imageRawData = reader.result;
		var url = window.location.protocol + "//" + window.location.host + "/TotalAgility/Services/SDK/StreamingService.svc/import/UpdateResourceProfile";

		// Http request to save the image
		var xhttp = new XMLHttpRequest();
		xhttp.onreadystatechange = function () {
			// Display alert in case of any errors
			if (this.readyState == 4 && this.status != 200) {
				alert(this.statusText);
			}
		};
		xhttp.open("POST", url, true);
		xhttp.setRequestHeader("Content-type", "*/*");
		xhttp.setRequestHeader("profile", JSON.stringify(profile));
		xhttp.setRequestHeader("SessionId", sessionId);
		xhttp.send(imageRawData);
	};

	reader.readAsArrayBuffer(imageControl.getFiles()[0]);
}

var sessionId = Forms.SessionVariables.getSessionVariable('SESSION_ID');

var profile = {
	"DisplayName": Forms.Common.Common.GetResourceName(),
	Identity: {
		"Id": Forms.Common.Common.GetResourceID(),
		"Name": Forms.Common.Common.GetResourceName()
	},
	"ProfilePictureName": "",
	WorkingCategory: {
		"Id": thisForm.formVariables.getFormVariableByName('CategoryId').value
	}
};
var url = window.location.protocol + "//" + window.location.host + "/TotalAgility/Services/SDK/StreamingService.svc/import/UpdateResourceProfile";

// Http request to save the image
var xhttp = new XMLHttpRequest();
xhttp.onreadystatechange = function () {
	// Display alert in case of any errors
	if (this.readyState == 4 && this.status == 200) {
		Ext.Msg.show({
			title: 'Kofax TotalAgility',
			msg: Forms.Common.Lang.GetLocaleString('F1467A0C36C24FC9A5837193FD27D654', true),
			message: Forms.Common.Lang.GetLocaleString('F1467A0C36C24FC9A5837193FD27D654', true),
			scope: this,
			buttons: Ext.MessageBox.OK
		});
	}
};
xhttp.open("POST", url, true);
xhttp.setRequestHeader("Content-type", "*/*");
xhttp.setRequestHeader("profile", JSON.stringify(profile));
xhttp.setRequestHeader("SessionId", sessionId);
xhttp.send(null);
